import React from 'react';
import Cart from '../components/Cart';

const CartPage = ({ cartItems, removeFromCart }) => {
  return (
    <div className="cart-page">
      <h2>Your Cart</h2>
      <Cart cartItems={cartItems} removeItem={removeFromCart} />
    </div>
  );
};

export default CartPage;
